import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
export const RadioChannels = () => {
return (
<div>
   <section className="masthead">
      <div className="container">
         <div className="row">
            <div className="radioiframe">
               <iframe title="Radio Channels" frameborder="0" allowfullscreen="true" webkitallowfullscreen="true" mozallowfullscreen="true" oallowfullscreen="true" msallowfullscreen="true" src="https://technodroidz.in/"></iframe>
            </div>
         </div>
      </div>
   </section>
</div>
)
}
export default RadioChannels;
